import React from "react";
import { BrowserRouter as Router, Link } from "react-router-dom";
import style from "./SourcesButton.module.css";

function SourcesButton() {
  return (
    <div style={style.Button}>
      <Link to="/Sources">
        <h3> Sources </h3>
      </Link>
    </div>
  );
}

export default SourcesButton;
